import { Component, EventEmitter, Output } from '@angular/core';
import { BookModel } from '../../models/book.model';

@Component({
  selector: 'app-book-list',
  templateUrl: './book-list.component.html'
})
export class BookListComponent {
  books: BookModel[] = [
    {
      author: 'Author 1',
      description: `Cassie McDowell’s life in 1980s Minnesota seems perfectly wholesome. She lives on a farm, loves school, and has a crush on the nicest boy in class. Yes, there are her parents’ strange parties and their parade of deviant guests, but she’s grown accustomed to them.`,
      pages: 12,
      progress: 0,
      title: 'Unspeakable Things',
      uid: 1,
      screen: '',
    },
    {
      author: 'Author 2',
      description: 'Description 2',
      pages: 24,
      progress: 0,
      title: 'Title 2',
      uid: 2,
      screen: '',
    },
    {
      author: 'Author 3',
      description: 'Description 3',
      pages: 48,
      progress: 0,
      title: 'Title 3',
      uid: 3,
      screen: '',
    }
  ];

  @Output() showBook = new EventEmitter<BookModel>();

  processBookById(id: number): void {
    const book = this.books.find((item) => {
      return item.uid === id;
    });

    this.showBook.emit(book);
  }
}
